import React, { Component } from "react";
import styled from "styled-components";

class Table extends Component {
  render() {
    const Div_table_box = styled.div`
      width: 1112px;
      height: 690px;
      border-radius: 3px;
      border: 1px solid rgba(151, 151, 151, 0.39);
      box-shadow: 0 6px 8px 0 rgba(164, 164, 164, 0.28),
        4px 2px 4px 0 rgba(0, 0, 0, 0.09);
      background-color: #ffffff;
      position: relative;
      margin: 0 auto;
      top: -513px;
      overflow: hidden;
    `;

    const Div_table = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-around;

    `


    const Div_table_row = styled.div`
      display: flex;
      flex-direction: column;
      text-align: center;
    `;

  const Hr_table_horizontal_line = styled.hr`
  width: 875px;
  height: 0px;
  border: 1px solid rgba(151, 151, 151, 0.27);
  display: flex;
justify-content: center
`;


    return (
      <Div_table_box>
      Taher elsheikh
      <Hr_table_horizontal_line/>
      <Div_table>
        <Div_table_row>
          <p>mark_cuban@gmail.com</p>
          <p>
            sdfvkjsdfglksdjhfglksdjhgf;ksdjhfgkjsdhvksdjbfv;sjdf;kajdhfgkdajhgv@gmail.com
          </p>
        </Div_table_row>
        <Div_table_row>
          <p>FOUND</p>
          <p>FOUND</p>
        </Div_table_row>
        </Div_table>
      </Div_table_box>
    );
  }
}

export default Table;
